package com.mindq.java;

public class Abcd {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a,b,c;
		a=4;
		b=5;
		c = a +b;
		System.out.println(c);
		
		// operators
		c = a - b;
		System.out.println(c);
		c = a * b;
		System.out.println(c);
		c = a/b;
		System.out.println(c);
		c = a % b;
		System.out.println(c);
	}

}
